import Header from 'src/components/Header';
import Footer from 'src/components/Footer';
import Intro from 'src/sections/Intro';
import About from 'src/sections/About';
import Services from 'src/sections/Services';
import Portfolio from 'src/sections/Portfolio';
import Director from 'src/sections/Director';
import MoreServices from 'src/sections/MoreServ';
import Testimonials from 'src/sections/Clients';
import Contacts from 'src/sections/Contacts';
import BonusPage from 'src/pages/BonusPage';
import ExtraPage from 'src/pages/ExtraPage';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Intro />
      <About />
      <Services />
      <Portfolio />
      <Director />
      <MoreServices />
      <Testimonials />
      <Contacts />
      <BonusPage />
      <ExtraPage />
      <Footer />
    </div>
  );
}

export default App;
